import createDataContext from "./createDataContext"

const authReducer = (state, action) => {
	console.log('state: ', state);
	switch (action.type) {
		default:
			return state;
	}

}

export const { Context, Provider } = createDataContext(authReducer, { }, { isSingedIn: false })
